        dic = {'9': '1989', '0': '1990', '1': '1991', '2': '1992', '3': '1993', '4': '1994', '5': '1995', '6': '1996', '7': '1997', '8': '1998'}
        length = len(s)
        if len(s) == 1:
            return dic[s]
        pos = [s]
        pre = 1
        if s[0] == '0' or len(s) < 4 or (len(s) == 4 and int(s) < 1989):
            pos = []
        count = 0
        while count < length:
            if int(str(pre) + s) >= 1989:
                pos.append(str(pre) + s)
                count += 1
            pre += 1
        for i in range(1, length):
            year = get_year(s[i:])
            try:
                pos.remove(year)
            except ValueError:
                pass
        return pos[0]
    results = []
    for abb in abbreviations:
        year_str = get_year(abb[1:])
        results.append(int(year_str))
    return results

